<!DOCTYPE html>
<html>
<head>
    <meta charset="UTF-8">
    <title>Swagger UI</title>
    <link rel="icon" type="image/png" href="thirdparty/springfox-swagger-ui/images/favicon-32x32.png" sizes="32x32"/>
    <link rel="icon" type="image/png" href="thirdparty/springfox-swagger-ui/images/favicon-16x16.png" sizes="16x16"/>
    <link href="thirdparty/springfox-swagger-ui/css/typography.css" media='screen' rel='stylesheet' type='text/css'/>
    <link href="thirdparty/springfox-swagger-ui/css/reset.css" media="screen" rel="stylesheet" type="'text/css"/>
    <link href="thirdparty/springfox-swagger-ui/css/screen.css" media="screen" rel="stylesheet" type="text/css"/>
    <link href="thirdparty/springfox-swagger-ui/css/reset.css" media="print" rel="stylesheet" type="text/css"/>
    <link href="thirdparty/springfox-swagger-ui/css/print.css" media="print" rel="stylesheet" type="text/css"/>
    <script src="thirdparty/springfox-swagger-ui/lib/object-assign-pollyfill.js"></script>
    <script src="thirdparty/springfox-swagger-ui/lib/jquery-1.8.0.min.js"></script>
    <script src="thirdparty/springfox-swagger-ui/lib/jquery.slideto.min.js"></script>
    <script src="thirdparty/springfox-swagger-ui/lib/jquery.wiggle.min.js"></script>
    <script src="thirdparty/springfox-swagger-ui/lib/jquery.ba-bbq.min.js"></script>
    <script src="thirdparty/springfox-swagger-ui/lib/handlebars-4.0.5.js"></script>
    <script src="thirdparty/springfox-swagger-ui/lib/lodash.min.js"></script>
    <script src="thirdparty/springfox-swagger-ui/lib/backbone-min.js"></script>
    <script src="thirdparty/springfox-swagger-ui/swagger-ui.min.js"></script>
    <script src="thirdparty/springfox-swagger-ui/lib/highlight.9.1.0.pack.js"></script>
    <script src="thirdparty/springfox-swagger-ui/lib/highlight.9.1.0.pack_extended.js"></script>
    <script src="thirdparty/springfox-swagger-ui/lib/jsoneditor.min.js"></script>
    <script src="thirdparty/springfox-swagger-ui/lib/marked.js"></script>
    <script src="thirdparty/springfox-swagger-ui/lib/swagger-oauth.js"></script>

    <script src="thirdparty/springfox-swagger-ui/springfox.js"></script>
</head>

<body class="swagger-section">
<div id='header'>
    <div class="swagger-ui-wrap">
        <a id="logo" href="http://swagger.io"><img class="logo__img" alt="swagger" height="30" width="30" src="thirdparty/springfox-swagger-ui/images/logo_small.png" /><span class="logo__title">swagger</span></a>
        <form id='api_selector'>
            <div class='input'>
                <select id="select_baseUrl" name="select_baseUrl"/>
            </div>
            <div class='input'><input placeholder="http://example.com/api" id="input_baseUrl" name="baseUrl" type="text"/></div>
            <div id='auth_container'></div>
            <div class='input'><a id="explore" class="header__btn" href="#" data-sw-translate>Explore</a></div>
        </form>
    </div>
</div>

<div id="message-bar" class="swagger-ui-wrap" data-sw-translate>&nbsp;</div>
<div id="swagger-ui-container" class="swagger-ui-wrap"></div>
</body>
</html>
